import React from 'react'
import { useEffect } from 'react';
import { Link } from 'react-router-dom';
function Header() {

  
  

  const aut = localStorage.getItem('user');

  
  
  
  return (
    <div className='header'>
        <ul className='hList'>
            <li className='menu'><Link to = '/'>Home </Link></li>
            <li className='menu'><Link to = '/add'>Add</Link></li>
            <li className='menu'><Link to = '/update'>Update</Link></li>
            <li className='menu'><Link to = '/logout'>Logout</Link></li>
            <li className='menu'><Link to = '/profile'>Profile</Link></li>
            
            
       
      aut? :<li className='menu'><Link to= '/signup'>Sign UP</Link></li>
        </ul>
    </div>
  )
}

export default Header
